import React, { Component } from "react";
import { Accordion, Card, Button } from "react-bootstrap";

export default class StudentFormCard extends Component {
  render() {
    return (
      <Card>
        <Card.Header class="sfc-header">
          <Accordion.Toggle as={Button} variant="link" eventKey="0">
            Personal Information
          </Accordion.Toggle>
        </Card.Header>
        <Accordion.Collapse eventKey="0">
          <Card.Body class="sfc-body">
            Body for personal information card
          </Card.Body>
        </Accordion.Collapse>
      </Card>
    );
  }
}
